  const loadUser = async () => {
    const res = await fetch(`http://localhost:3001/userdb/${props.id}`);
    setUsers(await res.json());
  };

  useEffect(() => {
    loadUser();
  }, []);

  return (
    <>
      <h1>User View</h1>
    </>
  );
}

